import React, { Component } from 'react';
import obruc from  '../assets/art/obruc.jpg'

class Artwork extends Component {
  render() {
    return(
      <div className="artwork">
        <img src="../assets/art/obruc.jpg" alt="obruc" />
      </div>
    );
  }
}

export default Artwork;
